	add("debacle", "{\"term\":\"debacle\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"French\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\", \"Occitan\"], \"text\":\"From French \u0027débâcle\u0027 () from \u0027débâcler\u0027 (to unbar; unleash) from prefix \u0027dé-\u0027 (un-) + \u0027bâcler\u0027 (to dash, bind, bar, block) from Middle french (ca. 1400-1600) from Old french (842-ca. 1400) \u0027bâcler\u0027 from Middle dutch (ca. 1050-1350) \u0027bakkelen\u0027 (to freeze artificially, lock in place) from \u0027bakken\u0027 (to stick, stick hard, glue together) Also attested in Old french (842-ca. 1400) \u0027desbacler\u0027 (to clear a harbour by getting ships unloaded to make room for incoming ships with lading) and in Occitan \u0027baclar\u0027 (to close) Modern sense of \u0026quot;bar, block\u0026quot; stems from influence from Latin \u0027baculum\u0027 (staff) The word \u0027débâcle\u0027 is first attested in the early 19th century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An event or enterprise that ends suddenly and disastrously, often with humiliating consequences\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1952\u0027\u0027, Maimonides, translated by Boaz Cohen, \u0027w:Epistle to Epistle to Yemen\u0027 s:Epistle to page 5\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The event proved to be a great \u0027\u0027debacle\u0027\u0027 for the partisans of this prognosticator\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Richard L. Canby, \u0026quot;SOF: An Alternative Perspective on Doctrine\u0026quot;, in Schultz \u0027et al\u0027 (eds), \u0027Roles And Missions of SOF In The Aftermath Of The Cold War\u0027, [http://books.google.ca/books?id\u003d4cL366lEXXYC\u0026amp;pg\u003dPA188\u0026amp;vq\u003ddebacle\u0026amp;source\u003dgbs_search_r\u0026amp;cad\u003d1_1\u0026amp;sig\u003dACfU3U2ploE86HBGFygXYHid2sTmm_-Fhg p. 188\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The result is a military approach which maximizes political tensions with Russia and lays the ground for a military \u0027\u0027debacle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002,\u0027\u0027 Jacqueline West, \u0027South America, Central America and the Carribean 2002\u0027, Routledge, ISBN 1-857431-21-9, page 68\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Falklands-Malvinas \u0027\u0027débâcle\u0027\u0027 provided the opportunity to restructure the military High Command; Alfonsín removed anti-democratic senior officers and replaced them with more co-operative ones\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, \u0027BP pipeline failure: hearing before the Committee on Energy and Natural Resources\u0027, \u0026quot;Statement by Peter Van Tuyn\u0026quot;, [http://books.google.ca/books?id\u003dPE2_-3X4G9sC\u0026amp;pg\u003dPA46\u0026amp;vq\u003ddebacle\u0026amp;source\u003dgbs_search_r\u0026amp;cad\u003d1_1\u0026amp;sig\u003dACfU3U04zvnb6kZ0563gBQJXa9YTnOSgwA p. 46\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The BP Prudhoe Bay \u0027\u0027debacle\u0027\u0027 [the w:Prudhoe Bay oil Prudhoe Bay oil spill] thus provides but the latest in a long line of reasons why leasing this region of the NPR-A is a bad idea\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A breaking up of a natural dam, usually made of ice, by a river and the ensuing rush of water\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1836\u0027\u0027, w:Henry De La Henry De La Beche, \u0027How to Observe: Geology\u0027, [http://books.google.ca/books?id\u003d3xQ5AAAAMAAJ\u0026amp;pg\u003dPA69\u0026amp;dq\u003ddebacle p. 69\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"so that in extreme cases the latter may even be dammed up for a time, and a \u0027\u0027debacle\u0027\u0027 be the consequence, when the main river overcomes the resistance opposed to it\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, John Lee Comstock, \u0027Outlines of Geology\u0027, [http://books.google.ca/books?id\u003dURoXAAAAYAAJ\u0026amp;pg\u003dPA51\u0026amp;vq\u003ddebacle p. 51\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"For several months after the \u0027\u0027debacle\u0027\u0027 just described, the river Dranse, having no settled channel, shifted its position continually\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1872,\u0027\u0027 Annual Report of the Board of Regents of the Smithsonian Institution\u0027, [http://books.google.ca/books?id\u003d_Y8KAAAAIAAJ\u0026amp;pg\u003dPA425\u0026amp;vq\u003ddebacle p. 425\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"When this \u0027\u0027débâcle\u0027\u0027 commences , the masses of ice, drifting with the current and unable to pass, are hurled upon those already soldered together; thus an enormous barrier is formed\", \"priority\":16}]}, \"synonyms\":{}}");

