	add("debarment", "{\"term\":\"debarment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act, an instance of debarring\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In the United States w:Food and Drugs Food and Drugs Act, a penalty imposed on persons or companies that commit crimes in connection with applications for approval of drugs, in which such persons are barred from submitting or assisting in the submission of such an application\", \"priority\":2}]}, \"synonyms\":{}}");

	add("debasement", "{\"term\":\"debasement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|debase|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of debasing or the state of being debased; a lowering, especially in character or quality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1832\u0027\u0027, w: Edgar Allan Edgar Allan Poe, \u0026quot;Bon Bon\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His large water-dog was acquainted with the fact, and upon the approach of his master, betrayed his sense of inferiority by a sanctity of deportment, a \u0027\u0027debasement\u0027\u0027 of the ears, and a dropping of the lower jaw not altogether unworthy of a dog\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, w:Edith Edith Wharton, \u0027The Reef\u0027, ch. 33\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She had given herself to Darrow, and concealed the episode from Owen Leath, with no more apparent sense of \u0027\u0027debasement\u0027\u0027 than the vulgarest of adventuresses\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Gilbert Cruz, \u0026quot;[http://www.time.com/time/arts/article/0,8599,1870930,00.html The Many Faces of Addiction] (Book review of \u0027America Anonymous: Eight Addicts in Search of a Life\u0027 by Benoit Denizet-Lewis),\u0026quot; \u0027Time\u0027, 12 Jan\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"There\u0027s something ugly and fascinating about reading such intimate tales of \u0027\u0027debasement\u0027\u0027 and depression and failure and self-doubt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The lowering of the value of a currency by reducing the amount of valuable metal in the coins\", \"priority\":8}]}, \"synonyms\":{}}");

	add("debatableness", "{\"term\":\"debatableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|debatable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being debatable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("debate", "{\"term\":\"debate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|debatre||to fight, contend, debate, also literally to beat down}}, from Romanic \u0027\u0027 from Latin {{m|la|dis-||apart, in different directions}} + {{m|la|battuere||to beat, to fence}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Strife, discord\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An argument, or discussion, usually in an ordered or formal setting, often with more than two people, generally ending with a vote or other decision\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An informal and spirited but generally civil discussion of opposing views\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d7|page\u003d26|magazine\u003d|title\u003d[http://www.theguardian.com/science/2013/jul/01/how-algorithms-rule-world-nsa How algorithms rule the passage\u003dThe use of algorithms in policing is one example of their increasing influence on our lives. And, as their ubiquity spreads, so too does the \u0027\u0027debate\u0027\u0027 around whether we should allow ourselves to become so reliant on them – and who, if anyone, is policing their use\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Discussion of opposing views\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/5/in-the-news-47 In the passage\u003dOxygen levels on Earth skyrocketed 2.4 billion years ago, when cyanobacteria evolved photosynthesis:. The evolutionary precursor of photosynthesis is still under \u0027\u0027debate\u0027\u0027, and a new study sheds light. The critical component of the photosynthetic system is the \u0026amp;ldquo;water-oxidizing complex\u0026amp;rdquo;, made up of manganese atoms and a calcium atom\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Frequently in French form \u0027débat) A type of literary composition, taking the form of a discussion or disputation, commonly found in the vernacular medieval poetry of many European countries, as well as in wikipedia:medieval medieval Latin\", \"priority\":7}]}, \"synonyms\":{}}");

	add("debater", "{\"term\":\"debater\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|debate}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who debates or participates in a debate; one who argues\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"William is a great debater\", \"priority\":2}]}, \"synonyms\":{}}");

	add("debauch", "{\"term\":\"debauch\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"1590s, from Middle french (ca. 1400-1600) \u0027desbaucher\u0027 (entice from work or duty) from Old french (842-ca. 1400) \u0027desbauchier\u0027 (to lead astray) from \u0027des-\u0027 () + \u0027bauch\u0027 (beam) from Frankish {{m|frk|*balko}},\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt; from Proto-germanic {{m|gem-pro|*balkô}}, from Proto-indo-european {{m|ine-pro|*bhelg-||beam, plank}}; latter origin of {{m|en|balk}}.Evolution of sense unclear; may be literally “to shave/trim wood to make a beam” or may be “to leave/lure someone from a workshop”, Frankish {{m|frk|*balko}} perhaps also meaning “workshop”.Possible corruption by way of Anglicised French term \u0027bord\u0027 meaning edge, kerb: kerb crawling as a synonym for prostitution. Parallels in modern German: \u0027Bordsteinschwalbe\u0026quot; (Lit transl: Kerb-stone-swallow or kerb-bird, a prostitute). English words bawd, bawdiness may be similarly connected.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An individual act of debauchery\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, Thomas Ebenezer Webb, \u0027The Mystery of William Shakespeare: A Summary of Evidence\u0027, page 242\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Greene died of a \u0027\u0027debauch\u0027\u0027; and Marlowe, the gracer of tragedians, perished in an ignominious brawl\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, w:Sax Sax Rohmer, \u0027The Insidious Dr. Fu Manchu\u0027, ch. 25\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"T]he room probably was one which he actually used for opium \u0027\u0027debauches\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An orgy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027, w:Joseph Joseph Heller, \u0027Catch-22\u0027, ch. 13\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"T]here were always the gay and silly sensual young girls that Yossarian had found and brought there and those that the sleepy enlisted men returning to Pianosa after their own exhausting seven-day \u0027\u0027debauch\u0027\u0027 had brought there\", \"priority\":8}]}, \"synonyms\":{}}");

	add("debauchee", "{\"term\":\"debauchee\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027débauché\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Somebody who is debauched; somebody who is dissolute and acts without moral restraint\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Person addicted to excessive indulgence in sensual pleasures\", \"priority\":2}]}, \"synonyms\":{}}");

