	add("debenture", "{\"term\":\"debenture\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Originally \u0027\u0027 from Latin \u0027debentur\u0027 (there are owing) supposedly the first word of such a document in early times.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A certificate that certifies an amount of money owed to someone; a certificate of indebtedness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A certificate of a loan made to the government; a government bond\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1942\u0027\u0027, Elliot Paul, \u0027The Last Time I Saw Paris\u0027, Sickle Moon 2001, p. 72\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Madame Corre, who made the important decisions after her plodding husband had spent hours on the ledger, sold the family \u0027\u0027debentures\u0027\u0027 and put the money into Dutch decurities\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A type of bond secured only by the general credit or promise to pay of the issuer, now commonly issued by large, well established corporations with adequate credit ratings\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003dThe Mirror and the chapter\u003d2|url\u003dhttp://openlibrary.org/works/OL1097634W|passage\u003d\u0027That\u0027 the young Mr. Churchills liked—but they did not like him coming round of an evening and drinking weak whisky-and-water while he held forth on railway \u0027\u0027debentures\u0027\u0027 and corporation loans. Mr. Barrett, however, by fawning and flattery, seemed to be able to make not only Mrs. Churchill but everyone else do what he desired\", \"priority\":6}]}, \"synonyms\":{}}");

	add("debit", "{\"term\":\"debit\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027debet\u0027 from Latin \u0027debilitum\u0027 (what is owed, a debt) neuter past participle of \u0027debere\u0027 () see debt.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In bookkeeping, an entry in the left hand column of an account\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cash sale is recorded as \u0027\u0027debit\u0027\u0027 on the cash account and as credit on the sales account\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sum of money taken out of a bank account. Thus called, because in bank\u0027s bookkeeping a cash withdrawal diminishes the amount of money held on the account, i.e. bank\u0027s debt to the customer\", \"priority\":3}]}, \"synonyms\":{}}");

