	add("debilitation", "{\"term\":\"debilitation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027débilitation\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of debilitating, or the condition of one who is debilitated; weakness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("debility", "{\"term\":\"debility\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027debylite\u0027 from Old french (842-ca. 1400) \u0027debilité\u0027 (French \u0027débilité\u0027 , from Latin \u0027debilitas\u0027 (weakness) from \u0027debilis\u0027 (weak) from \u0027de-\u0027 + \u0027habilis\u0027 (able)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of physical or mental weakness\", \"priority\":1}]}, \"synonyms\":{}}");

