	add("debora", "{\"term\":\"debora\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a less common spelling of Deborah\", \"priority\":1}]}, \"synonyms\":{}}");

	add("deborah", "{\"term\":\"deborah\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"From Hebrew \u0027lang\u003dhe\u0027 meaning bee.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A judge of Israel; a nurse of Rebecca\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And \u0027\u0027Deborah\u0027\u0027, a prophetess, the wife of Lapidoth, she judged Israel at that time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"popular from the 1940s to the 1970s, first in the USA, then in the UK\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027 James Brayshay: \u0027The Protector of Houghall, Or the Lily and the Rose\u0027. Groombridge and Sons, 1851. Act I\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Rapier\u0027. Heigho! \u0027\u0027Deborah\u0027\u0027! it\u0027s an ugly name, a damnable name - the name I mean! - it sounds like Gomorrah! Deb! Debby! - worse still - sounded sharp now I rather like it! - \u0027\u0027Deborah! Deborah! Deborah\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027 Carl Hiaasen: \u0027Stormy Weather\u0027. Alfred A.Knopf,Inc. ISBN 0679419829 page 256\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He hadn\u0027t known, for example, that her middle name was \u0027\u0027Deborah\u0027\u0027. It was a name he liked: plucky, Midwestern and reliable-sounding. He was willing to bet that if you went through every women\u0027s prison in America, you wouldn\u0027t find a half-dozen \u0027\u0027Deborahs\", \"priority\":7}]}, \"synonyms\":{}}");

	add("debouch", "{\"term\":\"debouch\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French \u0027déboucher\u0027 (de + bouche), modelled on Italian sboccare.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A narrow outlet from which a body of water pours\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, May 26, Phillip Carroll, \u0027Sulphur Mines in Sicily\u0027, in [http://www.gutenberg.org/files/27667/27667-h/27667-h.htm Scientific American Supplement, No 647\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In level portions of the country vertical shafts are preferred, but where the mine is situated upon a hill a debouch may often be found below the sulphur seam\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A fortress at the end of a defile\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1887\u0027\u0027, w:George B. George B. McClellan, \u0027McClellan\u0027s Own Story\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"To prevent another demonstration of this character, and to insure a \u0027\u0027debouch\u0027\u0027 on the south bank of the James, it became necessary to occupy Coggin\u0027s Point, which was done on the 3d, and the enemy driven back towards Petersburg\", \"priority\":6}]}, \"synonyms\":{}}");

	add("debra", "{\"term\":\"debra\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A spelling variant of Deborah first used in the 20th century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"popular in the 1950s and the 1960s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027 w:Marilyn Marilyn M. Segal, \u0027Run Away, Little Girl\u0027, Random House, 1966, page\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;She\u0027s \u0027\u0027Debra\u0027\u0027 Jean,\u0026quot; the children shouted in chorus. \u0026quot;We decided last night with Daddy.\u0026quot; - - - So her name is Debbie, I thought to myself. With a pretty name and a family to love her this baby has to make it\", \"priority\":3}]}, \"synonyms\":{}}");

	add("débridement", "{\"term\":\"débridement\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027débridemen. French|débridement\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The removal of damaged or foreign tissue from a wound\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Rodriguez-Merchan, \u0027The Haemophilic Joints: New Perspectives\u0027 (Blackwell 2003), page 96\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In view of the underlying pathology, \u0027\u0027débridement\u0027\u0027 is usually combined with late synovectomy.Category:English terms spelled with É\", \"priority\":3}]}, \"synonyms\":{}}");

	add("debriefing", "{\"term\":\"debriefing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of debriefing, or the state of being debriefed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The report of a mission or project, or the information so obtained\", \"priority\":2}]}, \"synonyms\":{}}");

	add("debris", "{\"term\":\"debris\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\"], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027débris\u0027 itself from \u0027dé-\u0027 (de-) + \u0027bris\u0027 (broken, crumbled) or from Middle french (ca. 1400-1600) \u0027debriser\u0027 (to break apart) from Old french (842-ca. 1400) \u0027debrisier\u0027 itself from \u0027de-\u0027 + \u0027brisier\u0027 (to break apart, shatter, bust) from Frankish {{m|frk|*brestan||to break violently, shatter, bust}}, from Proto-germanic {{m|gem-pro|*brestaną||to break, burst}}, from Proto-indo-european {{m|ine-pro|*bhrest-||to separate, burst}}. Cognate with Old high german (ca. 750-1050) \u0027bristan\u0027 (to break asunder, burst) Old english (ca. 450-1100) \u0027berstan\u0027 (to break, shatter, burst) More at burst.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Rubble, wreckage, scattered remains of something destroyed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Litter and discarded refuse\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21581981-what-pollution-some-opportunity-others-welcome-plastisphere Welcome to the passage\u003d[The researchers] noticed many of their pieces of [plastic marine] \u0027\u0027debris\u0027\u0027 sported surface pits around two microns across. Such pits are about the size of a bacterial cell. Closer examination showed that some of these pits did, indeed, contain bacteria,\u0026amp;nbsp;[\u0026amp;hellip\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The ruins of a broken-down structur\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Large rock fragments left by a melting glacier etc\", \"priority\":5}]}, \"synonyms\":{}}");

