	add("debtor", "{\"term\":\"debtor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027detour\u0027 from Latin \u0027debitor\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person or firm that owes money; one in debt; one who owes a deb\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who owes another anything, or is under obligation, arising from express agreement, implication of law, or principles of natural justice, to pay money or to fulfill some other obligation; in bankruptcy or similar proceedings, the person who is the subject of the proceeding\", \"priority\":2}]}, \"synonyms\":{}}");

	add("début", "{\"term\":\"début\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|début|lang\u003den}}, from \u0027débuter\u0027 (begin, start, lead off) \u0026lt;ref name\u003d\u0026quot;OED\u0026quot;\u0026gt;“[http://dictionary.oed.com/cgi/entry/50058434?single\u003d1\u0026amp;query_type\u003dword\u0026amp;queryword\u003ddebut\u0026amp;first\u003d1\u0026amp;max_to_show\u003d10 début, \u0027n.\u0027]” listed in the \u0027\u0027Oxford English Dictionary\u0027\u0027 [2\u0026lt;sup\u0026gt;nd\u0026lt;/sup\u0026gt; Ed.; 1989]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;ref name\u003d\u0026quot;OED\u0026quot;/\u0026gt; A person’s or thing’s first appearance before society or another audience; one’s “maiden voyage”.\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;/\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

